pragma solidity ^0.8.0;

import "../Market.sol";

bytes32 constant MARKETLIST = keccak256("MarketList");

contract MarketList is Market, MarketPathReader {
    using Array for address[];
    using Array for uint64[];
    using Array for uint256[];
    using Array for bytes32[];
    using MarketLib for address[];
    using MarketLib for SolutionSetDesc;
    using MarketLib for SolutionSet;
    using MarketLib for Remainer[];
    using MarketLib for Solution[];

    function id() public view virtual override (Market) returns (bytes32) {return MARKETLIST;}

    constructor(Repository rep_) Market(rep_) {}

    function list(
        uint256 start_,
        uint256 count_
    )
        public
        view
        returns (
           Order.InfoPublic[] memory out_
        )
    {
        (bool _result, ) = rep.get(MARKET).staticcall(
            abi.encodeWithSelector(
                bytes4(keccak256("d_list(uint256,uint256)")),
                address(this),
                start_,
                count_
            )
        );
        _return(_result);
    }

    function d_list(
        uint256 start_,
        uint256 count_
    )
        public
        view
        returns (
            Order.InfoPublic[] memory out_
        )
    {

        return
            __list(
                start_,
                count_
            );
    }

    function __list(
        uint256 start_,
        uint256 count_
    ) private view returns (Order.InfoPublic[] memory out_) {
        if (count_ == 0) count_ = _orderids.length;
        out_ = new Order.InfoPublic[](count_);

        uint256 outcount = 0;
        uint len = _orderids.length;
        for (uint i = start_; i < len; i++) {
            if (outcount >= count_) break;
            Order.Info storage order = _orders[_orderids[i]];
            if (
                (Order.isExpired(order) == 0 ||
                    Order.isExpired(order) >= block.timestamp)
            ) {
                out_[outcount] = __order(_orderids[i], false);
                outcount++;
            }
        }
        assembly {
            mstore(out_, outcount)
        }
    }

}
